import React, { Component } from 'react';

export default class VistaPrevia extends React.Component {

    constructor(props) {
        super(props);

        this.actualizacion = "10/20/21"
        this.cantInscritos = ""
        this.nombreTutor   = this.nombreTutor.bind(this);

      }

    /* actualizacion(){
        return <h1>"20/10/21"</h1>
    }
    cantInscritos(){
        return <p>22</p> 
    }
    nombreTutor(){
        return <p>"javi"</p> 

    } */


    render(){

        return (
            <>
                <div>
                    <h4>Titulo</h4>

                </div>

                <div>
                    <img src="" alt="imagen" />
                </div>

                <div>
                    <p>
                        Actualizacion:{this.actualizacion}
                    </p>
                    <p>
                        Cantidad de incritos:{this.cantInscritos}
                    </p>
                    <p>
                        Tutor del curos:{this.nombreTutor}
                    </p>
                </div>
            </>
        )
    }

}
